{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/oluwadarasimi99/google-capstone?scriptVersionId=94333153\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"<p id=\"part0\"></p>\n\n<p style=\"font-family: Times New Roman; line-height: 2; font-size: 24px; font-weight: bold; letter-spacing: 2px; text-align: center; color: #FF8C00\"> CYCLISTICS DATA FROM MARCH 2021 - MARCH 2022</p>\n\n<img src=\"https://images.squarespace-cdn.com/content/v1/5311febee4b019c52e31c1b1/1538913977343-4EGTPNA60516BJ0FDBL1/Bike_Fall_Chicago.jpg?format=1500w\" width=\"100%\" align=\"center\" hspace=\"5%\" vspace=\"5%\"/>\n\n\n","metadata":{}},{"cell_type":"markdown","source":"<p style=\"font-family: Times New Roman; font-size: 20px; font-style: normal; font-weight: bold; letter-spacing: 3px; color: #808080; line-height:1.0\"> TABLE OF CONTENT</p>\n​\n\n* [INTRODUCTION](#section-one)\n\n* [ASK](#section-two)\n\n* [PREPARE](#section-three)\n\n* [PROCESS](#section-four)\n\n* [ANALYSE](#section-five)\n\n* [SHARE](#section-six)\n\n* [ACT](#section-seven)\n​","metadata":{}},{"cell_type":"markdown","source":"<p style=\"font-family: Arials; line-height: 1.5; font-size: 16px; font-weight: bold; letter-spacing: 2px; text-align: center; color: #008000\">Thanks for checking my notebook, I hope you find it interesting..</p>\n<p style=\"text-align: center\">😊😊😊</p>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"section-one\"></a>\n<h1 id=\"basics\" style=\"font-family: Arials; font-size: 16px; font-style: bold; font-weight: bold; letter-spacing: 3px; color: #FF8C00\"> \n    1. INTRODUCTION 🎖\n        \n    \n</h1>\n\n\n\n\nThis is my project for the google data analytics capstone- Case study one which is about a cyclystic bike sharing company.The full documentation of this case study can be seen in the link below.\n\n<https://www.coursera.org/learn/google-data-analytics-capstone>\n\nThis project is essential so as to test the understanding of learners about the six data analytics process that was treated throughout the course which are\n* Ask\n* Prepare\n* Process\n* Analyse\n* Share\n* Act\n\n\n\n","metadata":{}},{"cell_type":"markdown","source":"\n<a id=\"section-two\"></a>\n<h1 id=\"markup\" style=\"font-family: Arials; font-size: 16px; font-style: bold; font-weight: bold; letter-spacing: 3px; color: #FF8C00\"> \n    2. ASK 🎖\n        \n    \n</h1>\n\n\n\n\nThis is the first phase of the data analytics process(ask questions to make data driven descision).\nin this case we will visit the documentation to get the proper context of our data.\n\n****Scenario****\n\nYou are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director\nof marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore,\nyour team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights,your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n\n****Characters and teams****\n\n● Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to\ncommute to work each day.\n\n● Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n\n● Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n\n\n● Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the\n\n\nGuiding questions\n\n● What is the problem you are trying to solve?\n  \n  The company's future success has been said to be dependent on maximizing the anual membership holder and hence the problem here is our to get casual riders to become annual members.\n\n● How can your insights drive business decisions?\n\nFrom the insights gotten, a new marketing strategy would be designed to convert casual riders to annual riders.\n\n***Key tasks***\n1. Identify the business task\n2. Consider key stakeholders\n\n***Deliverable***\nA clear statement of the business task\n\nTo better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics.\n\n***Guiding Questions.***\n1. How do annual members and casual riders use Cyclistic bikes differently?\n2. Why would casual riders buy Cyclistic annual memberships?\n3. How can Cyclistic use digital media to influence casual riders to become members?\n\n\n","metadata":{}},{"cell_type":"markdown","source":"\n<h1 id=\"center\" style=\"font-family: Arials; font-size: 16px; font-style: bold; font-weight: bold; letter-spacing: 3px; color: #FF8C00\"> \n    3. PREPARE 🎖\n        \n    \n</h1>\n\n\nCyclistic’s historical trip data to analyze and identify trends and the datasets. The data has been made available by Motivate International Inc. and can be downloaded directly from kaggle [via this link](https://www.kaggle.com/datasets/kevinvenza/cyclistic-bike-share) \n\n**Guiding Questions**\n\n● Where is your data located?\nThe dataset is located in kaggle [Through this link](https://www.kaggle.com/datasets/kevinvenza/cyclistic-bike-share) and can aslo be downloaded directly [from Divvy](https://divvy-tripdata.s3.amazonaws.com/index.html)\n\n● How is the data organized?\n\nThe data is prepared by year and month and each of the months has its own CSV file.\n\n● Are there issues with bias or credibility in this data? Does your data ROCCC?\n\nThere are no issues with bias and credibility as measures such as( removal of  trips that are taken by staff as they service and inspect the system; and any trips that were below 60 seconds in length (potentially false starts or users trying to re-dock a bike to ensure it was secure).) and yes the dataset is \n* reliable\n* original \n* comprehensive\n* current. \n* cited.\n\n● How are you addressing licensing, privacy, security, and accessibility?\n\n The company has their own licence over the dataset and there are no personal or very sensitive information about the riders in the dataset also accessing the dataset is quite easy. To review the company's licence [Click here](https://ride.divvybikes.com/data-license-agreement)\n \n● How did you verify the data’s integrity?\n\nThere are consistent namings for each columns and the data formats are correct for each column. Also null values are removed.\n\n● How does it help you answer your question?\n\nNoticable trends about the casual and annual riders can help understand the behaviour\n\n● Are there any problems with the data?\n\n***Key tasks***\n1. Download data and store it appropriately.\n2. Identify how it’s organized.\n3. Sort and filter the data.\n4. Determine the credibility of the data.\n\n***Deliverable***\n\nA description of all data sources used\n\nDivvy is Chicagoland’s bike share system across Chicago and Evanston. Divvy provides residents and visitors with a convenient, fun and affordable transportation option for getting around and exploring Chicago.\n\nDivvy, like other bike share systems, consists of a fleet of specially-designed, sturdy and durable bikes that are locked into a network of docking stations throughout the region. The bikes can be unlocked from one station and returned to any other station in the system. People use bike share to explore Chicago, commute to work or school, run errands, get to appointments or social engagements, and more.\n\nDivvy is available for use 24 hours/day, 7 days/week, 365 days/year, and riders have access to all bikes and stations across the system.\n\n\n","metadata":{}},{"cell_type":"code","source":"#setting up R enviroment\n\nlibrary(tidyverse)\nlibrary(lubridate)\nlibrary(ggplot2)\nlibrary(dplyr)\nlibrary(geosphere)\nlibrary(janitor)\nlibrary(magrittr)\nlibrary(repr)","metadata":{"execution":{"iopub.status.busy":"2022-04-29T14:00:14.71335Z","iopub.execute_input":"2022-04-29T14:00:14.716821Z","iopub.status.idle":"2022-04-29T14:00:16.42615Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.6     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.8\n\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n\n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n\n\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n\nAttaching package: ‘janitor’\n\n\nThe following objects are masked from ‘package:stats’:\n\n    chisq.test, fisher.test\n\n\n\nAttaching package: ‘magrittr’\n\n\nThe following object is masked from ‘package:purrr’:\n\n    set_names\n\n\nThe following object is masked from ‘package:tidyr’:\n\n    extract\n\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"***Downloading dataset.....**","metadata":{}},{"cell_type":"code","source":"#Loading the datasets...\ncyclist_202103 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202103-divvy-tripdata.csv\")\ncyclist_202104 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202104-divvy-tripdata.csv\")\ncyclist_202105 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202105-divvy-tripdata.csv\")\ncyclist_202106 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202106-divvy-tripdata.csv\")\ncyclist_202107 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202107-divvy-tripdata.csv\")\ncyclist_202108 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202108-divvy-tripdata.csv\")\ncyclist_202109 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202109-divvy-tripdata.csv\")\ncyclist_202110 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202110-divvy-tripdata.csv\")\ncyclist_202111 <- read.csv(\"../input/cyclistic-bike-sharing-march-2021-march-2022/202111-divvy-tr