 font-style: bold; font-weight: bold; letter-spacing: 3px; color: #FF8C00\"> \n    5. SHARE 🎖\n        \n    \n</h1>\n\n\n\nGuiding questions\n\n● Were you able to answer the question of how annual members and casual riders use Cyclistic bikes differently?\n\n 1. Yes from the insight gotten, it turns out that casual users tend to ride more on weekends (saturdays and sundays) and other weekdays and the members subscribers\n tends to ride more on weekdays(wednessday,tuesday,thursday,friday and monday) \n \n 2. Also the difference in the top 10 travel route for both casual users and membership subscribers was obvious.\n \n● What story does your data tell?\n\n**Interesting stories indeed!!!**\n\n1. According to [A chicago bike blog](https://www.chicagobikeblog.com/blog/2018/9/21/the-best-time-to-ride-your-bike-is-now), Autumn is the best season for cycling in chicago  this explains the reason while the highest number of trips by electric bike was recorded in September, October and November.\n\n2. Also it was clearly seen on the line graph that there was a rapid increase in the no of trip from 15 - 20 hours and its peak at about 17 hours. this numbers makes sense as  16 - 18 hours i.e 4pm - 6pm has been regarded by [Tripsavvy](https://www.tripsavvy.com/driving-in-chicago-what-you-need-to-know-4175905) as a rush hour hence there heavy traffic in that hour and this is a strong correlation with the increase in the use of bikes by that hour(15 - 18 hours).\n\n\n\n● How do your findings relate to your original question?\n\nThe finding tells that how members riding habits are different from casual riders. And how marketing team can make strategy to influence them through digital media.\n\n● Who is your audience? What is the best way to communicate with them?\n\nLily Moreno and the cyclistic executive team.\n\n● Can data visualization help you share your findings?\n\nYes it can the visuals makes it easier for stake holders to understand.\n\n● Is your presentation accessible to your audience?\n\nYes it is accessible to the audience.\n\nKey tasks\n1. Determine the best way to share your findings.\n2. Create effective data visualizations.\n3. Present your findings.\n4. Ensure your work is accessible.\nDeliverable\nSupporting visualizations and key findings\n","metadata":{}},{"cell_type":"markdown","source":"**Interesting Visuals**","metadata":{}},{"cell_type":"code","source":"#A line plot of number of rides against hour of day\noptions(repr.plot.width = 18, repr.plot.height = 10)\nggplot(Active_hour, aes(x = hour_of_day , y = number_of_rides)) + \n    geom_line(aes(color = member_casual, linetype = member_casual)) + \n    geom_point()\n    scale_color_manual(values = c(\"darkred\", \"steelblue\")) +\n    labs(title=\"rides by hour_of_day\", x = \"hour_of_day\", y = \"Number of Rides\")","metadata":{"execution":{"iopub.status.busy":"2022-04-29T14:06:01.71649Z","iopub.execute_input":"2022-04-29T14:06:01.717857Z","iopub.status.idle":"2022-04-29T14:06:02.420662Z"},"trusted":true},"execution_count":45,"outputs":[{"ename":"ERROR","evalue":"\u001b[1m\u001b[33mError\u001b[39m:\u001b[22m\n\u001b[33m!\u001b[39m Cannot add ggproto objects together. Did you forget to add this object to a ggplot object?\n","traceback":["\u001b[1m\u001b[33mError\u001b[39m:\u001b[22m\n\u001b[33m!\u001b[39m Cannot add ggproto objects together. Did you forget to add this object to a ggplot object?\nTraceback:\n","1. `+.gg`(scale_color_manual(values = c(\"darkred\", \"steelblue\")), \n .     labs(title = \"rides by hour_of_day\", x = \"hour_of_day\", y = \"Number of Rides\"))","2. abort(\"Cannot add ggproto objects together. Did you forget to add this object to a ggplot object?\")","3. signal_abort(cnd, .file)"],"output_type":"error"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACHAAAASwCAIAAAAW5rj+AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ5hkZZ034HMqd1VX58mBYQaGjBFURF2QFbNiABERcVFMqItrel1c17D6mldW\nxazrGpALFZVdFFcxvGAARcWVMDNMjp1zxfN+GJegAz2hu0