ta":{"image/png":{"width":1080,"height":600}}}]},{"cell_type":"markdown","source":"<h1 id=\"act\" style=\"font-family: Arials; font-size: 16px; font-style: bold; font-weight: bold; letter-spacing: 3px; color: #FF8C00\"> \n    6. ACT 🎖\n          \n</h1>\n\npreparation of final deliverables to Morena;\n\n\n\n\n","metadata":{}},{"cell_type":"markdown","source":"**Recomendations:**\n\n\n\n1. The top 10 route with the highest number of ride should be targeted, also  the later part of summer (July , August) and Autumn fall (September, October) which seem to have the highest trip should include nice membership subscription package and probably be a target  for the digital media campaign.\n \n\n\n2. More attractive membership offers should be made available for rush hour ride(4pm - 6pm  or 16hours - 18hours) as both casual and member rider have there peak number of trip by that hour.\n\n\n\n3. Exciting weekend offer should be made available for the membership subscription plan as most casual riders ride on weekends.\n\n\n\n4. Futher data could also be collected to ascertain reasons why they might not prefer annual member subcription.\n\n\n5. It was observed that member riders didnt use docked bike at all, the data collected did not specifically state that docked bike is not in the member riders subscription if so, it should be included in the plan to encourage casual riders who would want to ride docked bike.\n\n","metadata":{}},{"cell_type":"markdown","source":"<p style=\"font-family: Arials; line-height: 1.5; font-size: 16px; font-weight: bold; letter-spacing: 2px; text-align: center; color: #008000\">Thank you for reading this work!\nAny feedback on this work would be very grateful.\nIf you liked this notebook, put your votes.</p>\n    <p style=\"text-align: center\">😊😊😊</p>","metadata":{}}]}